import React from 'react';
import { useGlobalContext } from '../../context';

const Rank = () => {
  const { loadUser } = useGlobalContext;

  return (
    <div>
      <div className="white f3">{`${loadUser.name}, your current rank is...`}</div>
      <div className="white f1">{`${loadUser.entries}`}</div>
    </div>
  );
};

export default Rank;
